import React from 'react';

function CreatePost() {
  return (
    <div className="post-item" style={{ marginBottom: '20px' }}>
      <div className="post-header">
        <div className="post-avatar"></div>
        <input 
          type="text" 
          placeholder="What's on your mind?" 
          style={{
            flex: 1,
            border: 'none',
            background: '#f0f2f5',
            borderRadius: '20px',
            padding: '10px 15px',
            marginLeft: '10px'
          }}
        />
      </div>
    </div>
  );
}

export default CreatePost;
